Job_Description:
{
  "jobProfile": {
    "JobID": "SPE-001",
    "coreDetails": {
      "title": "Senior Python Engineer",
      "jobSummary": "We are looking for an experienced Senior Python Engineer to lead the development of our core backend infrastructure. You will be responsible for architecting high-performance APIs, optimizing database interactions, and mentoring junior developers in a distributed, remote-first team environment.",
      "employmentType": {
        "agreement": "Employee",
        "schedule": "Full-time",
        "term": "Permanent"
      },
      "jobLocation": {
        "type": "TELECOMMUTE",
        "applicantLocationRequirement": "Remote (Americas/Europe time zones preferred)"
      },
      "customTags": [
        "Backend",
        "SaaS",
        "Python"
      ],
      "extraNotes": "Quarterly virtual hackathons and annual in-person meetups."
    },
    "responsibilities": {
      "keyObjectives": [
        {
          "objective": "Migrate legacy monolith to microservices architecture.",
          "timeframe": "1 Year",
          "metric": "Decouple 4 core services with zero downtime and improved fault tolerance."
        },
        {
          "objective": "Reduce API latency.",
          "timeframe": "6 Months",
          "metric": "Optimize database queries and caching to decrease p95 latency by 30%."
        },
        {
          "objective": "Elevate code quality standards.",
          "timeframe": "First 90 Days",
          "metric": "Implement strict typing (mypy) and increase test coverage to >85%."
        }
      ],
      "dayToDayDuties": [
        "Architect, build, and maintain scalable RESTful APIs using FastAPI and Django.",
        "Design efficient database schemas and optimize complex SQL queries in PostgreSQL.",
        "Implement asynchronous task queues using Celery and Redis.",
        "Conduct thorough code reviews and provide technical mentorship to mid-level engineers.",
        "Collaborate with DevOps to streamline CI/CD pipelines and deployment strategies."
      ],
      "customTags": [
        "Architecture",
        "Optimization"
      ],
      "extraNotes": "Focus heavily on system design and scalability patterns."
    },
    "qualifications": {
      "skills": {
        "technical": [
          {
            "skillId": "PY-EXP-01",
