Job_Description:
{
  "jobProfile": {
    "JobID": "JFE-001",
    "coreDetails": {
      "title": "Junior Frontend Developer",
      "jobSummary": "We are seeking a creative and detail-oriented Junior Frontend Developer to join our user interface team. You will work closely with UX designers to translate wireframes into high-quality code, ensuring a seamless and responsive experience for users across all devices.",
      "employmentType": {
        "agreement": "Employee",
        "schedule": "Full-time",
        "term": "Permanent"
      },
      "jobLocation": {
        "type": "HYBRID",
        "applicantLocationRequirement": "Must reside within the Greater Seattle Area for weekly in-office collaboration."
      },
      "customTags": [
        "Frontend",
        "Web",
        "UI/UX"
      ],
      "extraNotes": "Flexible start hours between 8 AM and 10 AM."
    },
    "responsibilities": {
      "keyObjectives": [
        {
          "objective": "Revamp the customer dashboard.",
          "timeframe": "First 90 Days",
          "metric": "Achieve a 95% Google Lighthouse accessibility score and reduce load time by 15%."
        },
        {
          "objective": "Implement the new design system components.",
          "timeframe": "6 Months",
          "metric": "Deliver 20 reusable components to the shared library with 100% unit test coverage."
        }
      ],
      "dayToDayDuties": [
        "Develop new user-facing features using React.js and TypeScript.",
        "Ensure the technical feasibility of UI/UX designs.",
        "Optimize application for maximum speed and scalability.",
        "Collaborate with backend developers to integrate RESTful APIs.",
        "Participate in code reviews to maintain code quality and consistency."
      ],
      "customTags": [
        "Development",
        "Creative"
      ],
      "extraNotes": "Strong focus on pixel-perfect implementation."
    },
    "qualifications": {
      "skills": {
        "technical": [
          {
            "skillId": "TECH-FE-01",
            "skillName": "React.js",
            "importance": 10,
            "skillDescription": " proficiency in functional components and hooks.",
            "requiredProficiency": "Intermediate"
          },
          {
            "skillId": "TECH-FE-02",
            "skillName": "CSS3 / SCSS",
            "importance": 9,
            "skillDescription": "Deep understanding of flexbox, grid, and responsive design principles.",
            "requiredProficiency": "Expert"
          },
          {
            "skillId": "TECH-FE-03",
            "skillName": "TypeScript",
            "importance": 8,
            "skillDescription": "Ability to write strongly-typed code to reduce runtime errors.",
            "requiredProficiency": "Beginner"
          }
        ],
        "soft": [
          {
            "skillId": "SOFT-01",
            "skillName": "Attention to Detail",
            "importance": 10,
            "skillDescription": "Ability to spot visual misalignments and logic errors.",
            "requiredProficiency": "Expert"
          },
          {
            "skillId": "SOFT-02",
            "skillName": "Communication",
            "importance": 8,
            "skillDescription": "Articulating technical issues to non-technical designers.",
            "requiredProficiency": "Intermediate"
          }
        ]
      },
      "experience": {
        "requiredYears": 0,
        "description": "General experience."
      },
      "education": {
        "requiredCredential": "Bachelor's Degree in Computer Science or Interactive Media Design.",
        "acceptsExperienceInLieu": false
      },
      "customTags": [
        "Entry Level"
      ],
      "extraNotes": "Portfolio link required."
    },
    "evaluationStrategy": {
      "jobDescription": 65,
      "resume": 35
    },
    "customQuestions": [
      {
        "question": "What is the difference between the Virtual DOM and Real DOM?",
        "expectedAnswer": "Candidate should explain that Virtual DOM is a lightweight copy used for performance optimization before updating the Real DOM."
      },
      {
        "question": "How do you handle state management in a complex application?",
        "expectedAnswer": "Mention of Context API, Redux, or Zustand is expected."
      }
    ],
    "applicantTasks": [
      {
        "taskId": "TASK-FE-01",
        "maxUploadSizeMB": 20,
        "allowedFormats": [
          "zip",
          "pdf"
        ]
      }
    ],
    "companyContext": {
      "culture": "We are a design-first technology company. We value aesthetics as much as functionality and believe in a collaborative, ego-free creative process.",
      "growthOpportunities": "Structured career ladder from Junior to Principal Engineer. Annual education budget of $2,000.",
      "customTags": [
        "Design-First",
        "Creative"
      ],
      "extraNotes": "Dog-friendly office."
    },
    "compensation": {
      "salary": {
        "min": 75000,
        "max": 95000,
        "currency": "USD"
      },
      "benefits": [
        "Medical, Dental, and Vision Insurance",
        "Gym Membership Reimbursement",
        "15 Days Paid Time Off",
        "Hybrid Work Options"
      ],
      "customTags": [
        "Competitive"
      ],
      "extraNotes": "Performance bonus up to 10%."
    },
    "meta": {
      "schemaVersion": "1.3",
      "lastUpdated": "2025-01-15T10:00:00Z",
      "completenessStatus": "Complete",
      "missingFields": [],
      "customFields": {
        "team": "Product Design",
        "hiringPriority": "High"
      }
    }
  }
}

